contracts/certificate.sol.content:
//SPDX-License-Identifier:GPL-3.0
pragma solidity ^0.8.7;

contract GenerateCertificate {
    struct CertificateDetails {
        string userName;
        string certName;
        string CertificationLevel;
        string CreatedBy;
        uint256 creationDate;
    }
    /**
     *mapping: to store generated certificate
     */
    mapping(address => mapping(uint256 => CertificateDetails))
        private certificate;

    mapping(address => mapping(uint256 => bool)) private isCertified;

    uint256 private uinqueId = 0;

    /**
     *method: to generate certificate
     */
    function generateCertificate(
        string calldata _userName,
        string calldata certName,
        string calldata _CertificationLevel,
        string calldata _CreatedBy
    ) external {
        CertificateDetails memory myStruct = CertificateDetails({
            userName: _userName,
            certName: certName,
            CertificationLevel: _CertificationLevel,
            CreatedBy: _CreatedBy,
            creationDate: block.timestamp
        });

        certificate[msg.sender][uinqueId] = myStruct;
        isCertified[msg.sender][uinqueId] = true;
    }

    /**
     *method: to get certificate
     */
    function gEtYourCertificate(address _user, uint256 _Id)
        external
        view
        returns (CertificateDetails memory)
    {
        return certificate[_user][_Id];
    }

    /**
     *method: to  certificate verification
     */
    function verification(address _user, uint256 _uinqueId)
        external
        view
        returns (bool)
    {
        return isCertified[_user][_uinqueId];
    }
}

contracts/certificate2.sol.content:
//SPDX-License-Identifier:GPL-3.0
pragma solidity ^0.8.7;

contract GenerateCertificate {
    struct CertificateDetails {
        string email;
        string certName;
        string CertificationLevel;
        string issuerName;
        string issuerId;
        string issuedBy;
        string issuedByDesgnation;
        string creationDate;
        string certId;
        uint256 fees;
        uint256 maximumMarks;
        uint256 marks;
    }

    CertificateDetails public certificate;

    constructor(
        string memory _email,
        string memory _certName,
        string memory _CertificationLevel,
        string[] memory _issuerDetails,
        string memory _creationDate,
        string memory _certId,
        uint256 _fees,
        uint256 _maximumMarks,
        uint256 _marks
    ) {
        certificate = CertificateDetails({
            email: _email,
            certName: _certName,
            CertificationLevel: _CertificationLevel,
            issuerName: _issuerDetails[0],
            issuerId: _issuerDetails[1],
            issuedBy: _issuerDetails[2],
            issuedByDesgnation: _issuerDetails[3],
            creationDate: _creationDate,
            certId: _certId,
            fees: _fees,
            maximumMarks: _maximumMarks,
            marks: _marks
        });
    }
}

contracts/CreateContracts.sol.content:
//SPDX-License-Identifier: GPL-3.0
pragma solidity ^0.8.9;

contract UniblokContract {
    struct partyDetails {
        string jobTitle;
        string clientName;
        string serviceProvider;
    }
    struct contractOverview {
        uint256 estimatedBudget;
        uint256 estimatedHours;
        uint256 estimatedWeek;
        uint256 estimatedTeamSize;
        uint256 netSettlement;
    }
    struct serviceChargeDetails {
        uint256 uniblokServiceFee;
        uint256 expectedAmountToBeReceived;
        uint256 finalAmount;
    }
    struct typeAndDuration {
        string jobCategory;
        string OfferDate;
        string offerExpires;
        string expectedCompletionOn;
        string jobId;
        string acceptanceTime;
        string acceptanceDate;
    }
    partyDetails public partyDetail;
    contractOverview public ContractOverview;
    serviceChargeDetails public ServiceChargeDetails;
    typeAndDuration public TypeAndDuration;

    constructor(
        string[] memory _partyDetails,
        uint256[] memory _contractOverview,
        uint256[] memory _serviceChargeDetails,
        string[] memory _typeAndDuration
    ) {
        partyDetail = partyDetails({
            jobTitle: _partyDetails[0],
            clientName: _partyDetails[1],
            serviceProvider: _partyDetails[2]
        });
        ContractOverview = contractOverview({
            estimatedBudget: _contractOverview[0],
            estimatedHours: _contractOverview[1],
            estimatedWeek: _contractOverview[2],
            estimatedTeamSize: _contractOverview[3],
            netSettlement: _contractOverview[4]
        });
        ServiceChargeDetails = serviceChargeDetails({
            uniblokServiceFee: _serviceChargeDetails[0],
            expectedAmountToBeReceived: _serviceChargeDetails[1],
            finalAmount: _serviceChargeDetails[2]
        });
        TypeAndDuration = typeAndDuration({
            jobCategory: _typeAndDuration[0],
            OfferDate: _typeAndDuration[1],
            offerExpires: _typeAndDuration[2],
            expectedCompletionOn: _typeAndDuration[3],
            jobId: _typeAndDuration[4],
            acceptanceTime: _typeAndDuration[5],
            acceptanceDate: _typeAndDuration[6]
        });
    }
}

